import React from 'react';
import {timeConverter} from '../converter/converter';

const miniWeather = (props) => {
  const {dt,temp} = props; 
  return(
  <div className="hour_weather">
    <p>{timeConverter(dt)}</p>
    <p>{Math.floor(temp)}</p>
  </div>
  )
}

export default miniWeather;
